import React from 'react';
import "../node_modules/bootstrap/dist/css/bootstrap.min.css";
const App = () => {
  return (
    <>
      <h1 className="text-center my-4 text-dark">Welcome to Asit technical</h1>
      <button className="btn btn-primary my-2 mx-4">Thapa</button>
   
    </>
  );
}


export default App;
